import React from "react";
import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import "./App.css";
import { Card } from "primereact/card";
import Sidebar from "./components/Sidebar";
import Certifications from "./pages/Certifications";
import Contact from "./pages/Contact";
import Footer from "./components/Footer";
import ContactForm from "./components/ContactForm";
import Experiences from "./pages/Experiences";
import Formations from "./pages/Formations";
import Projects from "./pages/Projects";
import Nav from "./components/Nav";
import TinySlider from "tiny-slider-react";

function App() {
  return (
    <Router>
      <div className="background-image">
        <div className="container mb-5">
          {/* Navbar and Sidebar in the same row */}
          <div className="row">
            {/* Sidebar */}
            <div className="col-lg-3 col-md-4 mt-dynamic rp-md-0">
              <Sidebar />
              <div className="hidden-md w-100">
                <ContactForm />
              </div>
            </div>
            {/* Navbar */}
            <div className="col-lg-9 col-md-8 rp-md-0">
              <div className="glass-card bg-white mt-dynamic" id="res-nav">
                <Nav />
              </div>

              {/* Content area */}
              <div className="glass-card mt-4 content bg-white rm-md-0">
                <Routes>
                  <Route path="/" element={<Home />} />
                  <Route path="/Formations" element={<Formations />} />
                  <Route path="/Experiences" element={<Experiences />} />
                  <Route path="/Projects" element={<Projects />} />
                  <Route path="/Certifications" element={<Certifications />} />
                  <Route path="/Contact" element={<Contact />} />
                </Routes>
              </div>
            </div>

            <Footer />
          </div>
        </div>
      </div>
    </Router>
  );
}

function Home() {
  const settings = {
    lazyload: true,
    nav: false,
    controls: false,
    items: 3,
    autoplay: true,
    loop: true,
    autoplayTimeout: 10000,
    autoplayHoverPause: true,
    slideBy: 1,
    swipeAngle: false,
    speed: 400,
    responsive: {
      0: {
        items: 1,
      },
      990: {
        items: 2,
      },
      1400: {
        items: 3,
      },
    },
  };

  return (
    <section className="display-center text-center">
      <Card>
        <div className="mx-5 w-100">
          <h1 className="brb-anim" data-aos="fade-up" data-aos-delay="300">
            Hello there!!
          </h1>
          <p
            className="mt-4 intro-p mx-auto"
            data-aos="fade-up"
            data-aos-delay="100"
          >
            I'm <span className="font-weight-bold">Hernie</span>, your freelance{" "}
            <span className="font-weight-bold">programmer</span> will help you
            build your plans, projects and task in an organize and{" "}
            <span className="font-weight-bold">cheapest</span> way as possible.
          </p>
        </div>
      </Card>
      <Card>
        <section id="services" className="text-center bg-light pb-3">
          <p className="pt-5">What I can do</p>
          <h1
            className="brb-anim mb-5 mx-5"
            data-aos="fade-up"
            data-aos-delay="100"
          >
            <span className="text-warning font-weight-bold mr-1">M</span>Y
            SERVICES
          </h1>
          <div className="row px-3">
            <div className="col-md">
              <div id="sliderSection">
                <TinySlider settings={settings}>
                  <div className="item noselect">
                    <div className="card sh-s">
                      {/* Your slider content goes here */}
                    </div>
                  </div>
                  {/* Add more slider items as needed */}
                </TinySlider>
              </div>
            </div>
          </div>
        </section>
      </Card>
    </section>
  );
}

export default App;
